const result = [];
let count = 0;

// Obtenha o número enviado dinamicamente pelo webhook (remova os zeros à esquerda)
const numeroFiltrar = parseInt($('Webhook').item.json.body['Cep-Numero'], 10);
let encontrouCorrespondencia = false;

// Obtenha a lista de mensagens
const mensagens = $('HTTP Request1').item.json.msg;

// Ordena as mensagens pela proximidade do número ao número filtrado
const mensagensOrdenadas = mensagens.sort((a, b) => {
  const numeroA = parseInt(a.Número || "", 10);
  const numeroB = parseInt(b.Número || "", 10);
  const distanciaA = Math.abs(numeroA - numeroFiltrar);
  const distanciaB = Math.abs(numeroB - numeroFiltrar);
  return distanciaA - distanciaB;
});

// Primeira tentativa: encontrar correspondência exata
for (let i = 0; i < mensagensOrdenadas.length; i++) {
  const nome = mensagensOrdenadas[i].Nome || "N/A";
  const telefone = mensagensOrdenadas[i].Telefone || "";
  const numero = parseInt(mensagensOrdenadas[i].Número || "", 10);

  // Verifica se o número do imóvel corresponde ao número exato e se o telefone não está vazio
  if (numero === numeroFiltrar && telefone) {
    result.push(`*Nome:* _${nome}_\n*Nº Imóvel:* _${numero}_\n*Telefone:* _${telefone}_`);
    encontrouCorrespondencia = true;
    count++;
  }

  // Interrompe o loop após encontrar 20 entradas com telefone válido
  if (count >= 20) {
    break;
  }
}

// Se nenhuma correspondência exata foi encontrada, retorna os 50 números mais próximos
if (!encontrouCorrespondencia) {
  count = 0; // Reseta o contador para a nova busca
  for (let i = 0; i < mensagensOrdenadas.length; i++) {
    const nome = mensagensOrdenadas[i].Nome || "N/A";
    const telefone = mensagensOrdenadas[i].Telefone || "";
    const numero = parseInt(mensagensOrdenadas[i].Número || "", 10);

    // Verifica se o número está nos 50 números mais próximos
    if (Math.abs(numero - numeroFiltrar) <= 500 && telefone) {
      result.push(`*Nome:* _${nome}_\n*Nº Imóvel:* _${numero}_\n*Telefone:* _${telefone}_`);
      count++;
    }

    // Interrompe o loop após encontrar 50 entradas com telefone válido
    if (count >= 50) {
      break;
    }
  }
}

// Retorna o resultado ou uma mensagem indicando que nenhuma informação foi encontrada
return [
  { 
    result: result.length > 0 
      ? result.join('\n\n') 
      : "Nenhuma informação foi encontrada nos critérios especificados." 
  }
];

