const result = [];
let count = 0;

// Obtenha o número enviado dinamicamente pelo webhook (remova os zeros à esquerda)
const numeroFiltrar = parseInt($('Webhook').item.json.body['Cep-Numero'], 10);
let encontrouCorrespondencia = false;

// Obtenha a lista de mensagens
const mensagens = $('HTTP Request1').item.json.msg;

for (let i = 0; i < mensagens.length; i++) {
  const nome = mensagens[i].Nome || "N/A";
  const telefone = mensagens[i].Telefone || "";
  const numero = parseInt(mensagens[i].Número || "", 10);

  // Verifica se o número do imóvel corresponde ao número do webhook e se o telefone não está vazio
  if (numero === numeroFiltrar && telefone) {
    result.push(`*Nome:* _${nome}_\n*Telefone:* _${telefone}_`);
    encontrouCorrespondencia = true;
    count++;
  }

  // Interrompe o loop após encontrar 20 entradas com telefone válido
  if (count >= 20) {
    break;
  }
}

// Se nenhuma correspondência foi encontrada, busca os 3 números antes e 3 números depois
if (!encontrouCorrespondencia) {
  count = 0; // Reseta o contador para a nova busca
  for (let i = 0; i < mensagens.length; i++) {
    const nome = mensagens[i].Nome || "N/A";
    const telefone = mensagens[i].Telefone || "";
    const numero = parseInt(mensagens[i].Número || "", 10);

    // Verifica se o número está nos 3 números antes ou depois do número a ser filtrado
    if (Math.abs(numero - numeroFiltrar) <= 100 && telefone) {
      result.push(`*Nome:* _${nome}_\n*Telefone:* _${telefone}_`);
      count++;
    }

    // Interrompe o loop após encontrar 20 entradas com telefone válido
    if (count >= 20) {
      break;
    }
  }
}

// Retorna o resultado ou uma mensagem indicando que nenhuma informação foi encontrada
return [
  { 
    result: result.length > 0 
      ? result.join('\n\n') 
      : "Nenhuma informação foi encontrada nos critérios especificados." 
  }
];

const agora = new Date().toLocaleString("pt-BR", { timeZone: "America/Sao_Paulo" });

// Divide data e hora
const [dataStrRaw, horaStr] = agora.split(' ');
const dataStr = dataStrRaw.replace(',', '');

// Extrai dia, mês e ano
const [dia, mes, ano] = dataStr.split('/');
const dataFormatada = `${dia}/${mes}/${ano}`;

// Novo formato ISO (YYYY-MM-DD)
const dataISO = `${ano}-${mes}-${dia}`;

// Monta a URL da execução
const executionId = $execution.id;
const workflowId = $workflow.id;
const baseUrl = "https://n8n.redequeroimoveis.com";
const executionUrl = `${baseUrl}/workflow/${workflowId}/executions/${executionId}`;

// Retorna tudo em um único objeto
return [{
  json: {
    data: dataFormatada,
    data_iso: dataISO,
    hora: horaStr,
    executionUrl: executionUrl
  }
}];
